import "babel-polyfill";
import React from 'react'
import ReactDOM from "react-dom";
import * as serviceWorker from "./serviceWorker";
import App from './App';
import "react-app-polyfill/ie11";




ReactDOM.render(
  <React.StrictMode>
    <App></App>
  </React.StrictMode>,
document.getElementById("root")
);


serviceWorker.unregister();
